import React from 'react';
import './YoutubeComp.css';

const YoutubeComp = () => {
    return (
        <div className='Youtube-wrapper' >
            <div className='img-thumb'>
                <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.youtube.com%2F&psig=AOvVaw1TbMofc5UcEC2D3pFoPKRx&ust=1590407478203000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCJDN3t-3zOkCFQAAAAAdAAAAABAD" alt=""/>
                <p className='time'>7.12</p>
            </div>
            <p className='title'>title here</p>
            <p className='desc'>decs here</p>
        </div>
    )
}

export default YoutubeComp;
